import React from "react";
import Header from "./Header";


export default function Test(){

    return(

        <div className="test">
            <Header />
            <form>
                <label htmlFor="name">Nume</label>
                <input type="text" />
                <label htmlFor="email">Email</label>
                <input type="text" />
                <label htmlFor="password">Password</label>
                <input type="text" />
            </form>
            
        </div>
    )
}
